const tasks = [
    {
        id: 1,
        text: 'Enjoy last time with Chan',
        reminder: 'false'
    },
    {
        id: 2,
        text: 'Packing for Germany',
        reminder: 'true'
    },
    {
        id: 3,
        text: 'Calling Maggie for Dinner',
        reminder: 'true'
    }
]

const Tasks = () => {
    return (
        <>
        {tasks.map((task) => (<h3>{task.text}</h3>))}
        </>
    )
}

export default Tasks
